import { BrowserRouter, Route, Routes } from 'react-router-dom'
import HeaderComponent from './Components/HeaderComponent.js';
import NevbarComponent from './Components/NevbarComponents.js'

function App() {
  return (
    <div className="App">
      <NevbarComponent />
      <HeaderComponent />
      <BrowserRouter>
        <Routes>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
